INSERT INTO `stage` VALUES (1,'В работу','Точка принятия обязательств перед клиентом. С этого момента иджет отсчет времени когда мы договорились с клиентом о том что работа будет выполненна',8),(2,'Анализ в работе','Задачи которые взяли для анализа. Ответили на два вопроса: что делать и какой результат хотим получить.',9),(3,'Анализ Готово','есть план и можно брать в работу',10),(4,'Разработка в работе','Перед тем как запускать задачу в работу обсуждаем ТЗ. Решение задачи',11),(5,'Разработка в готово','Задача подготовленна для код ревью',12),(6,'Тестирование','На этом этапе мы ищем ошибки. Выгрузка в хранилище',13),(7,'UAT','В боевой базе. Происходит приемка пользователем. После приемки пользователем должна быть сформированна мини инструкция и проинформированны все пользователи.',15),(8,'Готово','Задача полность выполнена',16),(9,'Идея',NULL,1),(10,'Проработка в работе',NULL,2),(11,'Проработка Готово',NULL,3),(12,'USM',NULL,4),(13,'Архитектура',NULL,5),(14,'USM',NULL,6),(15,'Подготовлено в работу',NULL,7),(16,'Подготовлено в работу',NULL,7),(17,'Ready to delivery',NULL,14);
